import React from 'react';

import Td from './Td';
const index = ({data}) => {
	const dataRender = [].map((data) => <Td data={data} />);
	return (
		<table className="table table-bordered table-hover table-striped text-center" style={{width: '70%', height: '50%'}}>
			<thead>
				<tr className="dark">
					<td>link</td>
					<td>pics</td>
					<td>name</td>
					<td>id</td>
				</tr>
			</thead>
			<tbody>{dataRender}</tbody>
		</table>
	);
};

export default index;
